import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        My Hello WorlD
        <SecondComponents />
      </div>
    );
  }
}

class SecondComponents extends Component {
  render() {
    return (
      <div className="SecondComponents">
        My Second Components !!
      </div>
    );
  }
}
export default App;
